config_settings = {
    "BASEDIR" : BASEDIR,
    "OUTPUT_DIR": OUTPUT_DIR,
    "USE_ELEVATION": USE_ELEVATION,
    "USE_S1": USE_S1,
    "PATCH_SHAPE": PATCH_SHAPE,
    "KERNEL_BUFFER": KERNEL_BUFFER,
    "MODEL_DIR_NAME": MODEL_DIR_NAME,
    "OUTPUT_NAME": OUTPUT_NAME,
