    "GCS_IMAGE_PREFIX": GCS_IMAGE_PREFIX,
    "EE_OUTPUT_ASSET": EE_OUTPUT_ASSET,
}


import dotenv

config_file = "servir-aces/config.env"

for config_key in config_settings:
    dotenv.set_key(dotenv_path=config_file,
